import React from "react";


function App(){
    var count = 0;
    function increase(){
        count++;
    }
    return (
        <div>           
                 
            <b><h2>{count}</h2></b>
            <button onClick={increase}>+
    
            </button> 
         
         
         </div>
         );
    
}


    
    
export default App;
